import './App.css';
import {useState} from "react";
import Axios from "axios"; // for http requests

function App() {

  // creating states
  const [conceptId, setConceptId] = useState(0);
  const [conceptName, setConceptName] = useState("");

  //function for adding data
  const addConcept = () => {
    Axios.post();
  };

  return (
    <div className="App">
      <h1>Video Search with Deep Learning</h1>
    {/*  Just to Test for now*/}
      <label>Concept ID:</label>
      <input
          type="number"
          onChange={(event => {
            setConceptId(event.target.value)
          })}
      />
      <label>Concept Name:</label>
      <input
          type="text"
          onChange={(event => {
            setConceptName(event.target.value)
          })}/>
      <button onClick={addConcept}>Add Concept</button>
    </div>
  );
}

export default App;
